import React from 'react';
import '../../assets/css/others/Wpcardio.css';

const Wpcardio = () => {
  return (
    <div className="navbar-container">
      <nav className="sideways-navbar">
        <ul className="navbar-list">
          <li className="navbar-item"><a href="#home">Home</a></li>
          <li className="navbar-item"><a href="#about">About</a></li>
          <li className="navbar-item"><a href="#services">Services</a></li>
          <li className="navbar-item"><a href="#portfolio">Portfolio</a></li>
          <li className="navbar-item"><a href="#contact">Contact</a></li>
          <li className="navbar-item"><a href="#blog">Blog</a></li>
          <li className="navbar-item"><a href="#faq">FAQ</a></li>
          <li className="navbar-item"><a href="#support">Support</a></li>
        </ul>
      </nav>
    </div>
  );
}

export default Wpcardio;
